import React from 'react';

import styles from './Project1.module.css';

function Project1() {
    return (
        <React.Fragment>
            <h1>
                <img alt="Back" className={styles["back-button"]} width="25rem" src="https://image.flaticon.com/icons/png/512/60/60577.png"/>
                Job Scrapper
            </h1>
            <div classname={styles['project-div']}>
                <p class="source-code">Source Code (Python): <a rel="noreferrer" target="_blank" href="https://github.com/melihekici/LinkedInJobScrapper">github.com/melihekici</a></p>
                <p class="source-code">Source Code (Java): <a rel="noreferrer" target="_blank" href="https://github.com/melihekici/-LinkedInJobScrapper-Java-">github.com/melihekici</a></p>
            </div>

        </React.Fragment>
    );
};

export default Project1;
